DROP TABLE IF EXISTS `psu_price_list`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `psu_price_list` (
  `Id` int NOT NULL AUTO_INCREMENT,
  `link` text NOT NULL,
  `name` text NOT NULL,
  `price` int NOT NULL,
  `fid` varchar(100) NOT NULL,
  `rid` int NOT NULL,
  PRIMARY KEY (`Id`),
  KEY `fid` (`fid`),
  KEY `psu_price_list_ibfk_1_idx` (`rid`),
  CONSTRAINT `psu_price_list_ibfk_1` FOREIGN KEY (`fid`) REFERENCES `psu` (`ID`),
  CONSTRAINT `psu_price_list_ibfk_2` FOREIGN KEY (`rid`) REFERENCES `retailer` (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=135 DEFAULT CHARSET=utf8mb3;
/*!40101 SET character_set_client = @saved_cs_client */;

